import React from "react";
import ReactDOM from "react-dom";
import add, { min, div, mul } from "./App";
ReactDOM.render(
  <>
    <ul>
      <li>Sum of 2 digit is{add(5, 6)}</li>
      <li>Sub of 2 digit is{sub(7, 5)}</li>
      <li>Div of 2 digit is {div(99, 2)}</li>
      <li>Multiplication of 2 digit is {module(5, 7)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
